export const REGISTER_START = '[auth] REGISTER_START';
export const REGISTER_SUCCESS = '[auth] REGISTER_SUCCESS';
export const REGISTER_ERROR = '[auth] REGISTER_ERROR';
export const LOGIN_START = '[auth] LOGIN_START';
export const LOGIN_SUCCESS = '[auth] LOGIN_SUCCESS';
export const LOGIN_ERROR = '[auth] LOGIN_ERROR';
export const AUTH_LOADING = '[auth] AUTH_LOADING';


export const register = ({name, email, password, params}) => ({
  type: REGISTER_START,
  payload: {name, email, password, params}
});

export const loading = () =>({
  type: AUTH_LOADING
});

export const registerSuccess = (payload) =>({
  type: REGISTER_SUCCESS,
  payload
});

export const registerError = (payload) =>({
  type: REGISTER_ERROR,
  payload
});
